import styled from 'styled-components';

export const Section = styled.section`
    background: #000d1a;
    padding-bottom: 12rem;
    display: flex;
    flex-direction: column;
    justify-content: center;
`;

export const Content = styled.div`
    margin: auto;
    text-align: center;

`;

export const Img = styled.img`

`;
